import React from 'react';
import "./Dia.css"; 
import { useNavigate } from "react-router-dom";


const Dia = () => {
    const navigate = useNavigate();

  
    function handleLogin() {
      // Lógica de autenticação do usuário aqui
      navigate("/");
    }
    <div class="rectangle">
  <h2 class="rectangle-title">Título 1</h2>
  <h2 class="rectangle-title">Título 2</h2>
  <div class="rectangle-buttons">
    <button class="rectangle-button">Botão 1</button>
    <button class="rectangle-button">Botão 2</button>
  </div>
  <button class="rectangle-view-all-button" onClick={handleLogin}>Ver Todos</button>
</div>

}
export default Dia;
